<!doctype html>
<html lang="de">
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>VoiceWorks – Vorschau (Impressum als eigene Seite)</title>
  <style>
    :root{ --ink:#0f172a; --muted:#475569; --border:#e6e9ef;
           --btn-grad: linear-gradient(90deg,#2563eb,#d946ef,#10b981);
           --grad1: conic-gradient(from 180deg at 50% 50%, #60a5fa33, #f472b633, #34d39933, #60a5fa33); }
    *{box-sizing:border-box} html,body{margin:0;padding:0;font:16px/1.6 system-ui,Segoe UI,Inter,Arial,sans-serif;color:var(--ink);}
    .wrap{max-width:1120px;margin:0 auto;padding:0 16px}
    header{position:sticky;top:0;background:rgba(255,255,255,.82);backdrop-filter:blur(10px);border-bottom:1px solid var(--border);z-index:50}
    .scene{position:fixed;inset:0;z-index:-1;pointer-events:none}
    .blob{position:absolute;filter:blur(60px);opacity:.8;background:var(--grad1);border-radius:50%;animation:float 18s ease-in-out infinite}
    .blob.b2{animation-duration:22s;animation-delay:2s}.blob.b3{animation-duration:20s;animation-delay:4s}
    @keyframes float{0%{transform:translate(0,0)}25%{transform:translate(30px,-20px)}50%{transform:translate(-20px,15px)}75%{transform:translate(10px,-10px)}100%{transform:translate(0,0)}}
    h1{font-size:46px;margin:0;background:linear-gradient(90deg,#1d4ed8,#c026d3,#059669);-webkit-background-clip:text;background-clip:text;color:transparent}
    .muted{color:var(--muted)} .btn{display:inline-flex;align-items:center;gap:.5rem;border:1px solid #fbcfe8;background:var(--btn-grad);filter:saturate(1.1)color:#fff;padding:.8rem 1.1rem;border-radius:16px;box-shadow:0 12px 28px -12px rgba(99,102,241,.45);text-decoration:none}
    .btn:hover{filter:saturate(1.1);opacity:.95}
    .chip{display:inline-flex;align-items:center;gap:.4rem;border:1px solid var(--border);background:rgba(255,255,255,.65);padding:.35rem .6rem;border-radius:16px;box-shadow:inset 0 1px 0 rgba(255,255,255,.6),0 10px 24px -16px rgba(15,23,42,.35);font-size:.9rem}
    .card{background:rgba(255,255,255,.7);border:1px solid var(--border);border-radius:22px;box-shadow:inset 0 1px 0 rgba(255,255,255,.6),0 20px 40px -24px rgba(15,23,42,.28);padding:22px}
    section{padding:42px 0}
    .grid{display:grid;gap:18px}
    @media(min-width:640px){.grid-2{grid-template-columns:repeat(2,1fr)}.grid-3{grid-template-columns:repeat(3,1fr)}.grid-4{grid-template-columns:repeat(4,1fr)}.grid-6{grid-template-columns:repeat(6,1fr)}}
    .menu{position:relative} .menu-btn{display:inline-flex;align-items:center;justify-content:center;border:1px solid var(--border);background:#fff9;padding:.6rem .7rem;border-radius:12px;font-size:20px;margin-left:12px}
    .menu-panel{position:absolute;right:0;top:42px;width:200px;background:#fff;border:1px solid var(--border);border-radius:16px;box-shadow:0 20px 40px -20px rgba(15,23,42,.28);padding:8px}
    .menu-item{display:block;width:100%;text-align:left;border:0;background:transparent;padding:8px 10px;border-radius:10px}
    .menu-item:hover{background:#f8fafc}
  </style>
</head>
